import React from 'react'

function TodoList( {items} ) {
    return (
        <div className="todo-list">
                {items.map((item) => {
                    return <p key={item.id}>{item.content}</p>
                })}
            <div className="bottom-row">
                <p>{items.length} items left</p>
                <p>Clear completed</p>
            </div>
        </div>
    )
}

export default TodoList
